actionConfiguration.body:
() => {
		let not_elig_driver_data = appsmith.store.not_elig_driver_data;
		let duplicate_values = appsmith.store.duplicate_elements;
		if (typeof(not_elig_driver_data) == "undefined"){
			return "";
		}
		else if(not_elig_driver_data == "NOT_PROPER_CSV"){
			return "CSV does not have column name driver_id"
		}
		else if(duplicate_values.length>0){
			return `Duplicate Drivers: ${duplicate_values.join(", ")}`
		}
		let elig_string =  not_elig_driver_data.length == 0 ? "All Uploaded Drivers are Eligible" : `Not Eligible Drivers: ${not_elig_driver_data.join(", ")}`;
		return elig_string;
	}

